import { useContext } from "react"
import { AcordianProvider } from "../MainAcordian"
import { CiCircleMinus } from "react-icons/ci";


function RightAcordian() {
    const context = useContext(AcordianProvider)
    // console.log(context);
    return (
        <div>
            {context.state.selectedData ? context.state.selectedData.map((item) => {
                return <h4 key={item.id} className='btn btn-success'>
                    <button className="cros-btn">{item.sName} </button>
                    {<CiCircleMinus/>}
                  
                </h4>
            }) : <> </>}
        </div>
    )
}
export default RightAcordian
